import React from 'react';
import ReactDOM from 'react-dom';
import './styles/index.css';
import './semantic/dist/semantic.min.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

ReactDOM.render((
  <BrowserRouter>
    <App />
  </BrowserRouter>
  ), document.getElementById('root'));
